import React from 'react'

const Top10 = ({playlist}) => {

    const individualTop10items = playlist.track.map( (songObj, i) => {
        return(
            <Top10Item rank={i} songName={songObj.name} songArtist={songObj.artists}>
            </Top10Item>
        )
    })

    return(
        {individualTop10items}
    )
}

export default Top10
